   function removeTour(id){
    const newTours = tours.filter(tour => tour.id !==id);
    setTours(newTours);
   }

  return (
    <div>

      <h1>Plan your Journey</h1>
      <Tours dataremoveTour = {removeTour}></Tours>

    </div>
  );
}

export default App;
